import { render } from "react-dom";

class Symptoms extends React.Component {


    constructor(props) {
        super(props);

        this.symptomList = [
            "Sore Throat.",
            "Fatigue.",
            "Hungry for pizza.",
            "Tired of being home.",
            "Body aches.",
            "Empty Wallet.",
            "Sleepy",
            "TBD symptom",
            "Face mask tan",
            "Long hair or mullet",
            "Feeling hot outside"
        ];

        
        this.index = 0;
        
    }
  
    condition = true;

    while (condition) {
        setTimeout(myIndex(), 3000);
    }
    

    myIndex = () => {
        if ( this.index > (this.symptomList.length() -1) ) {
            this.index = 0;
        } else {
            this.index++;
        }
    }


render() {


    return (
        <div>
            <p>New Side Effects Include..</p>

            <div>{this.symptomList[this.index]}</div>
        </div>
    )
        



}


}

export default Symptoms;
